import React, { useState } from "react";
import { useAuth } from "../../context/AuthContext";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const CreateEmployee = () => {
    const [adminName, setName] = useState('')
    const [adminEmail, setEmail] = useState('')
    const [charges, setCharges] = useState('')
    const [description, setDescription] = useState('')
    const [adminPhone, setPhone] = useState()
    const [education, setEducation] = useState('')
    const [photo, setPhoto] = useState()
    const [experience, setExperience] = useState('')
    const navigate = useNavigate()
    const [auth, setAuth] = useAuth()

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const formData = new FormData();
            formData.append('adminName', adminName)
            formData.append('adminEmail', adminEmail)
            formData.append('description', description)
            formData.append('charges', charges)
            formData.append('adminPhone', adminPhone)
            formData.append('education', education)
            formData.append('experience', experience)
            formData.append("photo", photo)
            
            const res = await axios.post("/v1/admin/employee-data", formData);
            if (res.data.success) {
                navigate('/dashboard')
            }
        } catch (error) {
            console.log(error)
        }
    }

    return (
        <div style={{ display: "flex", flexDirection: "column", justifyContent: "center", alignItems: "center", minHeight: "100vh", backgroundColor: "#f4f4f4" }}>
            <div style={{ width: "50%", background: "#fff", padding: "30px", borderRadius: "10px", boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)" }}>
                <h2 style={{ textAlign: "center", color: "#333", marginBottom: "20px" }}>Create Employee Profile</h2>
                <form onSubmit={handleSubmit}>
                    <div style={{ marginBottom: "15px" }}>
                        <label>Name</label>
                        <input type="text" value={adminName} onChange={(e) => setName(e.target.value)} className="form-control" placeholder="Enter Name..." />
                    </div>
                    <div style={{ marginBottom: "15px" }}>
                        <label>Email</label>
                        <input type="email" value={adminEmail} onChange={(e) => setEmail(e.target.value)} className="form-control" placeholder="Enter Email..." />
                    </div>
                    <div style={{ marginBottom: "15px" }}>
                        <label>Base Charge (in $)</label>
                        <input type="number" value={charges} onChange={(e) => setCharges(e.target.value)} className="form-control" placeholder="Enter Base Charge..." />
                    </div>
                    <div style={{ marginBottom: "15px" }}>
                        <label>Phone No.</label>
                        <input type="number" value={adminPhone} onChange={(e) => setPhone(e.target.value)} className="form-control" placeholder="Enter Phone Number..." />
                    </div>
                    <div style={{ marginBottom: "15px" }}>
                        <label>Education</label>
                        <input type="text" value={education} onChange={(e) => setEducation(e.target.value)} className="form-control" placeholder="Enter Educational Background..." />
                    </div>
                    <div style={{ marginBottom: "15px" }}>
                        <label>LinkedIn URL</label>
                        <input type="text" value={experience} onChange={(e) => setExperience(e.target.value)} className="form-control" placeholder="Enter LinkedIn URL..." />
                    </div>
                    <div style={{ marginBottom: "15px" }}>
                        <label>Description</label>
                        <textarea value={description} onChange={(e) => setDescription(e.target.value)} className="form-control" placeholder="Describe the employee’s service fields..." />
                    </div>
                    <div style={{ marginBottom: "15px" }}>
                        <label>Photo</label>
                        <input type="file" onChange={(e) => setPhoto(e.target.files[0])} className="form-control" />
                    </div>
                    <button type="submit" style={{ width: "100%", padding: "10px", background: "#007bff", color: "#fff", border: "none", borderRadius: "5px", cursor: "pointer" }}>Add Employee</button>
                </form>
            </div>
        </div>
    );
};

export default CreateEmployee;
